// src/pages/UserProfile.js
import React from "react";
import { Link } from "react-router-dom";
import "../../styles/UserProfileCard.css";

const UserProfile = () => {
  // Example user data
  const user = {
    name: "Jill Anderson",
    role: "Sign Language Enthusiast",
    profileImage: "/assets/user-profile.jpg",
    bio: `Jill is a sign language learner who travels frequently, bridging communication gaps. She has been exploring advanced ASL grammar and Deaf culture to better serve her Deaf clients.`,
    age: 26,
    location: "Brooklyn, NY",
    hearingStatus: "Hard of Hearing",
    motivations: [
      { label: "Career", value: 80 },
      { label: "Travel", value: 60 },
      { label: "Speed", value: 70 },
      { label: "Loyalty/Mile", value: 50 },
    ],
    frustrations: [
      "Cannot find advanced sign language resources easily",
      "Wishes for more Deaf community events",
    ],
    goals: [
      "Become proficient in advanced ASL",
      "Improve sign language interpreting speed",
      "Explore sign language in different countries"
    ],
    favoriteBrands: ["Gallaudet University", "Netflix", "Zara", "Discord"]
  };

  return (
    <div className="profile-wrapper">
      {/* Header Section */}
      <header className="profile-header">
        <h1>Sign Language User Profile</h1>
        <Link to={`/profile/update`} className="edit-button">
          Edit/Update Profile
        </Link>
      </header>

      {/* Main Card */}
      <div className="profile-card">
        {/* Left Column: Profile Image & Basic Info */}
        <div className="profile-left">
          <div className="profile-image">
            <img
              src={user.profileImage}
              alt={user.name}
            />
          </div>
          <div className="profile-basic-info">
            <h2>{user.name}</h2>
            <p className="role">{user.role}</p>
            <p className="location">Age: {user.age} | {user.location}</p>
            <p className="hearing-status">Hearing Status: {user.hearingStatus}</p>
          </div>
        </div>

        {/* Right Column: Detailed Info */}
        <div className="profile-right">
          {/* Bio */}
          <div className="profile-section bio-section">
            <h3>Bio</h3>
            <p>{user.bio}</p>
          </div>

          {/* Motivations */}
          <div className="profile-section motivations-section">
            <h3>Motivations</h3>
            <div className="motivation-bars">
              {user.motivations.map((mot, idx) => (
                <div key={idx} className="motivation-item">
                  <label>{mot.label}</label>
                  <div className="progress-bar">
                    <div
                      className="progress-fill"
                      style={{ width: `${mot.value}%` }}
                    ></div>
                  </div>
                </div>
              ))}
            </div>
          </div>

          {/* Frustrations */}
          <div className="profile-section frustrations-section">
            <h3>Frustrations</h3>
            <ul>
              {user.frustrations.map((f, i) => (
                <li key={i}>{f}</li>
              ))}
            </ul>
          </div>

          {/* Goals */}
          <div className="profile-section goals-section">
            <h3>Goals</h3>
            <ul>
              {user.goals.map((g, i) => (
                <li key={i}>{g}</li>
              ))}
            </ul>
          </div>

          {/* Favorite Brands */}
          <div className="profile-section brands-section">
            <h3>Favourite Resources/Brands</h3>
            <div className="brand-list">
              {user.favoriteBrands.map((brand, i) => (
                <span key={i} className="brand-item">
                  {brand}
                </span>
              ))}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default UserProfile;
